import React, { Fragment } from "react";

import { Layout, Card, Row, Col, Form, Input, Typography, Divider } from "antd";
const PersonalCabinet = () => {
  return (
    <Fragment>
      <Layout>
        <Layout.Content style={{ margin: "5em 16px" }}>
          <div
            style={{
              background: "#fff",
              padding: 44,
              minHeight: 380
            }}
            className="border secondary"
          >
            <Row>
              <Col xs={12}>
                <Card
                  style={{ width: "300px" }}
                  title="Information"
                  cover={
                    <Typography.Title className="mt-5">Name</Typography.Title>
                  }
                >
                  <Divider />
                  <Card.Meta title="1234" />
                </Card>
              </Col>
              <Col>
                <Form>
                  <Form.Item>
                    <Input />
                  </Form.Item>
                </Form>
              </Col>
            </Row>
          </div>
        </Layout.Content>
      </Layout>
    </Fragment>
  );
};

export default PersonalCabinet;
